window.bookSummaryJSON = "<p>A great war encroaches following the turbulent events of patch 17, casting a menacing shadow over both Demon Grounds and lands of the light races.&nbsp;</p> <p>Roused from a millennia-old slumber, dark gods seek to exact vengeance for their past defeat. Max finds himself at the epicenter of it all - with the lives of his woman, his friends, and all his people in the Wild Wood dependent on him.&nbsp;</p> <p>Two unlikely heroes must stand - and endure - against all odds: one a Black Demon from an ancient prophecy, the other a fabled Gray Lion....</p>"; 
